string Mode = "";
int CustID = 0;
int OrderNum = 0;
int QuoteNum = 0;
string CustCountry = "";
string CustName = "";
string OTSID = "";
bool OTS = false;
int OTSCountry = 0;

/* Determines Current Configuration Mode and order/quote specifics */
Mode = Context.Entity;
CustID = 0; /* Set to Zero when not used for testing*/
CustCountry = "";
OrderNum = Context.OrderNumber;
QuoteNum = Context.QuoteNumber;

/* ********************************************************************************************************************************************************************************** */

if (Mode == "Quote") {
	/* Retrieve details from Quote Header */
	bool available_QuoteHed = UDMethods.GetQuoteHed(ref Context.CompanyID, ref QuoteNum, out CustID, out OTSID, out OTS);


	/* Retrieves customer name using customer ID */
	string CustomerCountry;
	bool available_Customer = UDMethods.GetCustomer(ref Context.CompanyID, ref CustID, out CustName, out CustomerCountry);

	/* ************************************************************** */

	/* If no One Time ship to is specified gets shipment country specified at customer setup */
	if ((OTSID == "") && (!OTS)) {
			if (available_Customer) {
			 CustCountry = CustomerCountry;
		 }
	}

	/* ************************************************************** */
	/* If a saved shipto address is specified gets country info */
	if (OTSID != "") {
		bool available_ShipTo = UDMethods.GetShipToCountryNum(ref Context.CompanyID, ref OTSID, out OTSCountry);
		string CountryDescription;
		bool available_Country = UDMethods.GetCountryDescription(ref Context.CompanyID, ref OTSCountry, out CountryDescription);
		if (available_Country) {
			CustCountry = CountryDescription;
		}
	}

	/* If a saved shipto address is not specified and a One Time is defined gets country info */
	if (OTS) {
		int QuoteHedOTSCountryNum;
		available_QuoteHed = UDMethods.GetQuoteHedOTSCountryNum(ref Context.CompanyID, ref QuoteNum, out QuoteHedOTSCountryNum);
		if (available_QuoteHed) {
			OTSCountry = QuoteHedOTSCountryNum;
		}
		string CountryDescription;
		bool available_Country = UDMethods.GetCountryDescription(ref Context.CompanyID, ref OTSCountry, out CountryDescription);
		if (available_Country) {
			CustCountry = CountryDescription;
		}
	}

	Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + QuoteNum + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
	Inputs.var_shipcountry.Value = CustCountry;

} /* End Mode == "Quote" */

/* ********************************************************************************************************************************************************************************** */
if (Mode == "Order") {
	/* Retrieve details from Order Header */
	bool available_QuoteHed = UDMethods.GetOrderHed(Context.CompanyID, OrderNum, out CustID, out OTSID, out OTS);

	/* Retrieves customer name using customer ID */
	string CustomerCountry;
	bool available_Customer = UDMethods.GetCustomer(ref Context.CompanyID, ref CustID, out CustName, out CustomerCountry);

	/* ************************************************************** */

	/* If no One Time ship to is specified gets shipment country specified at customer setup */
	if ((OTSID == "") && (!OTS)) {
			if (available_Customer) {
			 CustCountry = CustomerCountry;
		 }
	}

	/* ************************************************************** */
	/* If a saved shipto address is specified gets country info */
	if (OTSID != "") {
		bool available_ShipTo = UDMethods.GetShipToCountryNum(ref Context.CompanyID, ref OTSID, out OTSCountry);
		string CountryDescription;
		bool available_Country = UDMethods.GetCountryDescription(ref Context.CompanyID, ref OTSCountry, out CountryDescription);
		if (available_Country) {
			CustCountry = CountryDescription;
		}
	}

	/* If a saved shipto address is not specified and a One Time is defined gets country info */
	if (OTS) {
		int QuoteHedOTSCountryNum;
		bool available_OrderHed = UDMethods.GetOrderHedOTSCountryNum(ref Context.CompanyID, ref OrderNum, out QuoteHedOTSCountryNum);
		if (available_OrderHed) {
			OTSCountry = QuoteHedOTSCountryNum;
